description:
In 2000, the Belgian comic book artist and writer Crisse (Didier Chrispeels) introduced the first of a series of comic books featuring Atalanta, who is also abandoned by her father but saved by goddesses and nurtured by a bear. She is adopted by the hunters who killed the bear and becomes well known for her fast running. The series focuses mainly on her adventures with the Argonauts whom she accompanies as a means of later joining the Amazons. The series also features Jason, Hercules, and other heroes and gods and goddesses of Greek mythology, though the emphasis is mainly on humour. 
